campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 717, \"fields\": {\"priority\": 1, \"description\": \"March 2023: You and your Party Co-Leader, Robert Habeck, want to decide together who will be the Green Party chancellor candidate in around a month. Until then, what do you want to do to prepare for the upcoming election season?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 718, \"fields\": {\"priority\": 1, \"description\": \"The Corona Pandemic is the topic that is dominating the news and political discourse right now. With the Greens not governing on the federal level, you can do little in terms of actual policy though. What’s something you want to focus on concerning COVID policies?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 719, \"fields\": {\"priority\": 1, \"description\": \"April 2021: You’ve come to an agreement with your co-party leader Habeck. You both want to avoid a chaotic contest, and he agrees to give you precedence to become chancellor candidate. Now is the time to give your first speech as the official front-woman and first Green candidate with a shot at the chancellery!\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 720, \"fields\": {\"priority\": 1, \"description\": \"After a messy leadership contest, the CDU has chosen Armin Laschet as their chancellor candidate. With this, you, the CDU/CSU and the SPD have all chosen a chancellor candidate. Now it's time to decide on a general strategy for this pivotal race.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 721, \"fields\": {\"priority\": 1, \"description\": \"With a Green chancellor now looking like a realistic option, many are curious about your foreign policy. Can you clarify your position on that?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 722, \"fields\": {\"priority\": 1, \"description\": \"May 2021: The Federal Constitutional Court just ruled the Climate Protection Act as unconstitutional and demands the government do more to lower emissions. The federal government in Berlin is now working on passing a stricter law. You’re participating in the debate about this in the Bundestag.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 723, \"fields\": {\"priority\": 1, \"description\": \"While you are the chancellor candidate for the Green Party, many in the party wonder how you want to use your co-party leader, Robert Habeck, in this campaign. What do you want him to focus on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 724, \"fields\": {\"priority\": 1, \"description\": \"Over the past few years, you’ve received several payments from the Green Party for your activity as party leader. While the payments themselves were perfectly legal, you’ve forgotten to report them to the parliament as you have to and are now under heavy criticism from the press.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 725, \"fields\": {\"priority\": 1, \"description\": \"Time and time again, the Green Party has said that more needs to be done about climate change. In an interview, you are now asked what this means concretely for the price of gasoline.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 726, \"fields\": {\"priority\": 1, \"description\": \"June 2021: You’ve come under fire for irregularities in your CV. After the problems with your extraparliamentary earnings, this is yet another topic which threatens to destroy your image of competency.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 727, \"fields\": {\"priority\": 1, \"description\": \"Since 2005, long-time unemployed people in Germany get money from the state at the subsistence level, the so-called Hartz IV. However, they receive less money if they are not looking for a job. Many people are not happy with this system - what does the Green Party want to change?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 728, \"fields\": {\"priority\": 1, \"description\": \"A policy field which has been a surprisingly big topic this election - likely due to the Covid pandemic and subsequent lockdowns - is digitalization. What plans does the Green Party have?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 729, \"fields\": {\"priority\": 1, \"description\": \"One possible measure to reduce carbon emissions that has been suggested by your party again and again is a general speed limit on the German Autobahn. Yet again, you’re asked about this in an interview.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 730, \"fields\": {\"priority\": 1, \"description\": \"July 2021: Recently, you published your book, 'Jetzt. Wie wir unser Land erneuern'. It has been found that you copied many passages verbatim from internet sources or newspaper articles. How do you react to these accusations?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 731, \"fields\": {\"priority\": 1, \"description\": \"Widespread flooding is affecting large areas of western, southern and middle Germany. Other politicians, like Laschet, are travelling to the affected areas. Do you want to go there too?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 732, \"fields\": {\"priority\": 1, \"description\": \"After the devastating floodings, climate change is once again a much-discussed topic in the media and politics. You are expected to make a statement on this topic, did this catastrophe affect your stance?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 733, \"fields\": {\"priority\": 1, \"description\": \"It’s now less than two months until the election, and the campaign is heating up. Is there any specific region you want to focus on until election day?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 734, \"fields\": {\"priority\": 1, \"description\": \"August 2021: The Covid vaccine has become widely available to the whole population this summer. While a lot of people have gotten it already, the vaccination campaign has become sluggish in recent weeks. What should be done about that in your opinion?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 735, \"fields\": {\"priority\": 1, \"description\": \"Early in the campaign, it looked like you were the woman that could beat the CDU. However, it seems increasingly clear that with your current polling that this won’t happen. Voters are starting to give Olaf Scholz and the SPD a second look, causing him to surge and you to collapse.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 736, \"fields\": {\"priority\": 1, \"description\": \"One topic that’s important basically every election season is tax policy. Many people wonder how you want to finance all the new spending you promise - do you want to raise taxes to achieve that?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 737, \"fields\": {\"priority\": 1, \"description\": \"The election is in about a month now, and as usual, there will most probably be a coalition government afterwards. Which parties do you want to talk to?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 738, \"fields\": {\"priority\": 1, \"description\": \"Pictures of the disastrous retreat of NATO troops from Afghanistan go around the globe. The government is sharply criticised for its botched evacuation. What is your opinion on the matter?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 739, \"fields\": {\"priority\": 1, \"description\": \"September 2021: For the first time in German history, a Green Party candidate has been invited to the chancellor debate. In another first, the debate will be three-way, between you, Olaf Scholz of the SPD and Armin Laschet of the CDU. Who do you want to focus on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 740, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Olaf Scholz, vice chancellor and candidate of the SPD. What do you want to attack him on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 741, \"fields\": {\"priority\": 1, \"description\": \"It’s the final days of the campaign now, the election will happen very soon. With whom do you want to campaign in these last few days?\", \"likelihood\": 1.0}}]");
extraQuestions = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 742, \"fields\": {\"priority\": 1, \"description\": \"The CDU/CSU had a massive scandal with some of their MPs selling overpriced medical masks earlier this year, while SPD chancellor candidate Scholz has allegedly been involved in a scheme to help banks avoid paying taxes and has overseen the collapse of financial service provider Wirecard as finance minister. Do you want to try capitalizing on this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 743, \"fields\": {\"priority\": 1, \"description\": \"As the election comes closer, many voters are giving you a closer look. The fact that you’ve gone straight into politics after university without working a normal job opens up criticisms of elitism and being out of touch. How do you want to address this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 744, \"fields\": {\"priority\": 1, \"description\": \"July 2021: Recently, you published your book, 'Jetzt. Wie wir unser Land erneuern'. It has been found that you copied many passages verbatim from internet sources or newspaper articles. How do you react to these accusations?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 745, \"fields\": {\"priority\": 1, \"description\": \"You’ve just published a book called  'Jetzt. Wie wir unser Land erneuern'. Do you want to make it a big part of your election campaign?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 746, \"fields\": {\"priority\": 1, \"description\": \"August 2021: The Covid vaccine has become widely available to the whole population this summer. While a lot of people have gotten it already, the vaccination campaign has become sluggish in recent weeks. What should be done about that in your opinion?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 747, \"fields\": {\"priority\": 1, \"description\": \"Throughout the campaign, Olaf Scholz and the SPD have struggled in the polls, and while some people were sceptical of you in the spring, your polling numbers are still good. What’s your strategy for the final few weeks of the campaign?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 748, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Armin Laschet, Miniter-President of North Rhine-Westphalia and chancellor candidate of the CDU. What do you want to attack him on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 749, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on presenting your case to the German people without too strong attacks. What are your main points?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 4000, \"fields\": {\"question\": 717, \"description\": \"I’m working on a book together with a journalist right now. When I release the book this summer, I want it to be good - so I’ll focus all my energy on finishing that.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4001, \"fields\": {\"question\": 717, \"description\": \"If I want to become chancellor, I can’t be dragged down by unnecessary scandals. I’ll make sure my finances are in order and will check if there are any problems with my website or other things on the internet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4002, \"fields\": {\"question\": 717, \"description\": \"My name recognition is not that high. I want to get out there, go to talk shows, give interviews, and generally make sure the German people know me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4003, \"fields\": {\"question\": 717, \"description\": \"Friday for Future is capable of mobilizing a massive amount of people. I will visit some demonstrations and meet with their leadership to get them on our side.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4004, \"fields\": {\"question\": 718, \"description\": \"Overall, we support the government’s policy. I will criticize their sometimes chaotic response but also make it clear that we broadly stand behind all necessary measures.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4005, \"fields\": {\"question\": 718, \"description\": \"Since the beginning of the pandemic, there hasn’t been enough of a focus on children and families. We will present a plan to get them back to school quickly and provide financial aid for them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4006, \"fields\": {\"question\": 718, \"description\": \"While the lockdowns were absolutely necessary at the beginning of the pandemic, we should be mindful - there has to be a balance between freedom and safety.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4007, \"fields\": {\"question\": 718, \"description\": \"I will use this as an example of the general problems with our government and the CDU in particular - they only act once a crisis is happening and don’t do enough to prepare us beforehand!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4008, \"fields\": {\"question\": 719, \"description\": \"With my candidacy, I want to make the whole country an offer —a compelling invitation to lead our diverse and prosperous nation into a bright future.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4009, \"fields\": {\"question\": 719, \"description\": \"Forty years ago, the Green Party was founded to make our politics care more about the environment. more about the environment. Today, I continue in this tradition, as the only candidate that truly takes climate change seriously.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4010, \"fields\": {\"question\": 719, \"description\": \"After eight years of Grand coalition and sixteen years of CDU chancellorship, this country needs change. I’m the right woman to give this country the new start it needs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4011, \"fields\": {\"question\": 719, \"description\": \"We have a historic opportunity to win the chancellorship for the Green Party this election. I want to be a chancellor for everyone and promise to focus on sensible reform and proposals.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4012, \"fields\": {\"question\": 720, \"description\": \"It’s clear that the SPD is not going to win this election. I want to present myself as the candidate of the left-of-centre and try to coalesce left-wing voters around the Greens.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4013, \"fields\": {\"question\": 720, \"description\": \"Traditionally, the Greens have been a left-of-centre party. However, to actually win this, we need to draw voters from the CDU. Armin Laschet is a weak candidate and I’ll present myself as a competent alternative to both the status quo and him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4014, \"fields\": {\"question\": 720, \"description\": \"Our base is largely young, urban, and well-off. We will put our resources into mobilizing them and getting the youth to turn out his election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4015, \"fields\": {\"question\": 720, \"description\": \"Our polling numbers in West Germany are great, but we are struggling to even get to 10% in many East German states. There is an untapped voter potential for us there, so let’s focus on East Germany.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4016, \"fields\": {\"question\": 721, \"description\": \"While we want to remain a member of NATO, of course, we need to move on from the unnecessary goal to spend 2% of our gross domestic product on defence. We need to instead spend our defence budget more efficiently.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4017, \"fields\": {\"question\": 721, \"description\": \"We have to be tougher on states that don’t care about human rights, like Russia and China. For example, I’m in favour of stopping to build the North-Stream 2 pipeline and stopping to import products from China that might have been produced using forced labour.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4018, \"fields\": {\"question\": 721, \"description\": \"The Green Party has always been the party of pacifism. We need to drastically reduce our military spending and rethink our relationship with NATO. There are more important things we can spend this money on.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4019, \"fields\": {\"question\": 721, \"description\": \"We don’t want to rock the boat here. I want to reaffirm our commitment to NATO but also emphasize that diplomatic solutions are always preferable to military conflicts.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4020, \"fields\": {\"question\": 722, \"description\": \"We can’t hide behind ambitious goals for 2030 or 2040 or whenever, the time to act is now! We wasted time in the last years, and we have to quickly make up for it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4021, \"fields\": {\"question\": 722, \"description\": \"Five years ago, this house ratified the Paris climate accords. Every democratic party here agrees that something needs to be done, so let’s find solutions together.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4022, \"fields\": {\"question\": 722, \"description\": \"We need more than just goals we want to achieve, we need to talk about concrete measures to actually achieve this. After the next election, we want to form a dedicated ministry for Climate policy to coordinate our efforts better.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4023, \"fields\": {\"question\": 722, \"description\": \"We have had many transformations in the history of this country: Introducing the social market economy after World War 2, the reunification and European integration after 1990. Now is the time for another transformation and a Green New Deal for Europe.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4024, \"fields\": {\"question\": 723, \"description\": \"He’s very popular in his home state Schleswig-Holstein. I want him to campaign there during this election campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4025, \"fields\": {\"question\": 723, \"description\": \"We are co-party leaders and I want to campaign a lot as a duo. He’s especially knowledgeable on economic and fiscal policy, so I want him to unveil and explain our plans on these topics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4026, \"fields\": {\"question\": 723, \"description\": \"Actually, Habeck is probably more knowledgeable on a lot of topics than me. I’ll mostly talk about generic things while letting him focus on policy details.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4027, \"fields\": {\"question\": 723, \"description\": \"A good strategy would be to use him to attack our opponents, while I remain above the fray and positive.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4028, \"fields\": {\"question\": 724, \"description\": \"I apologize for this mistake, I’ve reported this now. I hope people will quickly move on from this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4029, \"fields\": {\"question\": 724, \"description\": \"This was just a small lapse of judgement - nothing compared to the corrupt mask deals in the CDU/CSU and Scholz’ Wirecard and cum-ex scandal.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4030, \"fields\": {\"question\": 724, \"description\": \"Other politicians have received much higher payments in the same timeframe. This is why the Green Party stands for more transparency regarding the earnings of MPs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4031, \"fields\": {\"question\": 725, \"description\": \"Unfortunately, if we want to lower our carbon emissions, the price of gasoline has to rise by about 16 cents per litre over the next five years.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4032, \"fields\": {\"question\": 725, \"description\": \"As the price of CO2 rises, so will the price of gasoline. We have to keep an eye on affordability, but a price hike is unavoidable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4033, \"fields\": {\"question\": 725, \"description\": \"Gas prices have to rise a lot - around 28 cents per litre over the next five years. We need to invest in public transit as well to make individual traffic less attractive overall.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4034, \"fields\": {\"question\": 725, \"description\": \"After the price for CO2 went into effect at the beginning of the year, gas prices have risen by 6 cents per litre already - for now, this is enough.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4035, \"fields\": {\"question\": 726, \"description\": \"I apologise for these mistakes, which have been corrected now. However, we shouldn’t lose sight of the more important topics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4036, \"fields\": {\"question\": 726, \"description\": \"This is a non-issue, the media is trying to find a scandal where there is none. I will fight back against these unfair allegations.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4037, \"fields\": {\"question\": 726, \"description\": \"If you want to see my correct CV, just look at my website - I don’t get what people are getting so upset about.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4038, \"fields\": {\"question\": 726, \"description\": \"It was never my goal to embellish my CV, I just made some honest mistakes here. I have to admit, I'm really annoyed with myself for letting this slip through.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4039, \"fields\": {\"question\": 727, \"description\": \"We need to change how benefits are calculated so that everyone is receiving at least 50€ more. Furthermore, there should be no more sanctions if someone isn’t actively looking for a job.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4040, \"fields\": {\"question\": 727, \"description\": \"The current level of Hartz IV is a disgrace. There needs to be a massive raise, by around 200€, and an end to the unnecessary and inhumane sanctions for people not searching for a job.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4041, \"fields\": {\"question\": 727, \"description\": \"Instead of Hartz IV, there should be a higher, universal basic income for all people in Germany. While this is expensive, the savings on bureaucracy make it possible to finance this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4042, \"fields\": {\"question\": 727, \"description\": \"The system needs some minor adjustments - we can look into gradually raising the amount of money paid out but have to be careful that it doesn’t become excessive.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4043, \"fields\": {\"question\": 728, \"description\": \"The Grand coalition has failed Germany in this regard, as was plain to see during the lockdowns. Under a Green government, we will put a lot of resources into modernising the digital infrastructure of this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4044, \"fields\": {\"question\": 728, \"description\": \"We have to do a lot more to make our government data transparent. Non-personal data should be made public for all citizens.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4045, \"fields\": {\"question\": 728, \"description\": \"Frankly, it’s embarrassing how much government agencies still rely on old-fashioned methods. We have to make investments here to help them build more modern, digital systems.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4046, \"fields\": {\"question\": 728, \"description\": \"For too long, we have relied on American companies for everything related to digitalization. We need German and European solutions, to be more independent and protect our data better.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4047, \"fields\": {\"question\": 729, \"description\": \"I want to reaffirm our position here -  we need a general tempo limit of 130 km/h to reduce carbon emissions. We have to hit our emission targets somehow and reducing traffic emissions is one part of that.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4048, \"fields\": {\"question\": 729, \"description\": \"We need a tempo limit, yes, but not just for climate reasons: A lot of accidents and deaths could be avoided if people wouldn’t be speeding excessively.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4049, \"fields\": {\"question\": 729, \"description\": \"With a general tempo limit being so unpopular, that is not something we want to focus on in the next legislative session. However, we will look into introducing new tempo limits on selected highways.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4050, \"fields\": {\"question\": 729, \"description\": \"Not only do we need a general tempo limit of 130 km/h on highways, but we also need one of 30 km/h within city limits - that would be a truly effective measure against climate change.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4051, \"fields\": {\"question\": 730, \"description\": \"I’ve made some mistakes, yes, but these accusations are unfair and completely blown out of proportion. I will get a media lawyer to fight back.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4052, \"fields\": {\"question\": 730, \"description\": \"It was a mistake to publish the book in its current state and I apologize for this lapse in judgement. My intention was not to deceive anyone, I simply quoted widely available facts.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4053, \"fields\": {\"question\": 730, \"description\": \"This book hasn’t been written by just me, I had a co-author. I’ll make it clear that most of the problematic parts were his responsibility and I didn’t have much to do with them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4054, \"fields\": {\"question\": 730, \"description\": \"I won’t give this smear campaign any oxygen. This book is a biography, not a scientific text, and this right-wing propaganda war against my person is pathetic.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4055, \"fields\": {\"question\": 731, \"description\": \"No, it would be improper to try to politicize this catastrophe. I’m of course making statements supporting all the emergency responders, but I won’t go there myself just to get some pictures.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4056, \"fields\": {\"question\": 731, \"description\": \"I will travel to some of the affected regions, yes. However, I don’t want the press to be around, I just want to talk to some affected people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4057, \"fields\": {\"question\": 731, \"description\": \"Yes, I want to go there. Specifically, I want to go to some affected cities with Green Party mayors. I’ll look at the devastation and make a public statement with them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4058, \"fields\": {\"question\": 731, \"description\": \"I don’t want to go there, but I’ll send my co-party leader Habeck there. He is better at talking to people in situations like this. Meanwhile, I’m of course mentioning the catastrophe in speeches.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4059, \"fields\": {\"question\": 732, \"description\": \"We, the Green Party, have said for decades that we need to do more against climate change to avoid catastrophes like this. That’s why we call, for example, for an end of using coal to produce electricity by 2030.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4060, \"fields\": {\"question\": 732, \"description\": \"I don’t want to come across as wanting to profit from this disaster. Instead of talking about climate change, I will talk about helping the victims in the coming days.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4061, \"fields\": {\"question\": 732, \"description\": \"This catastrophe has shown that we need to do much, much more to prepare for flooding and other extreme weather events. At the same time, we need to do more to reduce our carbon emissions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4062, \"fields\": {\"question\": 732, \"description\": \"Of course, we need to do more against climate change. I want to specifically call out Armin Laschet here - he said that a day like this is no reason to change anything. What else does he need to see to realize that something must be done?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4063, \"fields\": {\"question\": 733, \"description\": \"Our party colleagues in the Saarland had some conflict and didn’t manage to settle on a valid candidate list yet. Let’s help them sort this out.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4064, \"fields\": {\"question\": 733, \"description\": \"Winfried Kretschman, the only Green Minister-President, has just won his reelection this spring and is very popular. I want to campaign with him in Baden-Württemberg and South Germany in general.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4065, \"fields\": {\"question\": 733, \"description\": \"I’m quite content with our polling numbers in West Germany, but we are still far behind in East Germany. I want to focus on this region, both by travelling there and promising do to more to help them catch up.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4066, \"fields\": {\"question\": 733, \"description\": \"The states of Berlin and Mecklenburg-Vorpommern have their state elections parallel to our federal elections. I want to campaign there to help our leading candidates in these elections.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4067, \"fields\": {\"question\": 734, \"description\": \"It is legitimate that unvaccinated people don’t have the same rights and privileges as vaccinated people. Maybe that will help convince everyone to get vaccinated.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4068, \"fields\": {\"question\": 734, \"description\": \"We are doing a lot to get everyone vaccinated right now without thinking about the consequences. What if the vaccine is toxic? We should try some more natural medicine instead.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4069, \"fields\": {\"question\": 734, \"description\": \"At this point, we don’t need mandatory vaccinations yet, though it is something that is probably needed later on if the vaccination rates stay too low.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4070, \"fields\": {\"question\": 734, \"description\": \"Overall, we are on the right path with the vaccination campaign. We need to do more to reach everyone though, including mobile vaccination teams going to areas with low vaccination rates.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4071, \"fields\": {\"question\": 735, \"description\": \"I’m very concerned about this development. In the next weeks, I will focus on attacking him and his party to stop the bleeding.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4072, \"fields\": {\"question\": 735, \"description\": \"Of course, I’m very disappointed about this. However, honestly, we are still very likely going to be part of the next government and I’d rather govern with Scholz than with Laschet. I won’t attack him and voters that want to switch to him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4073, \"fields\": {\"question\": 735, \"description\": \"While it looks unlikely that I’ll win the chancellorship now, it’s still important that we get a strong Green Party in the next parliament. I will keep campaigning just as before and try to win over as many voters as possible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4074, \"fields\": {\"question\": 736, \"description\": \"To finance necessary government spending, taxes on the rich have to be raised. We should reinstate the wealth tax and raise the income tax, but in a way that leaves small and medium-income earners unaffected.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4075, \"fields\": {\"question\": 736, \"description\": \"Effectively combatting climate change is our number one priority, and to finance this, taxes need to be raised across the board. The wealthy will of course have to bear the highest increase, but unfortunately, everyone will have to contribute more.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4076, \"fields\": {\"question\": 736, \"description\": \"We need to raise taxes on the rich a bit, yes. However, we also need to modify the clause in our constitution that disallows too much government borrowing. It should be possible to take out loans for investments in important projects.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4077, \"fields\": {\"question\": 736, \"description\": \"Well, people are right, all the things we promised to do to combat climate change are very expensive. It’s more important to not raise taxes though, so unfortunately, we have to abandon a lot of those promises and only do what’s affordable with current state income.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4078, \"fields\": {\"question\": 737, \"description\": \"The party we have the most overlap with is the SPD - therefore, I want to form a government with them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4079, \"fields\": {\"question\": 737, \"description\": \"I want to categorically rule out a coalition with the Left party, they are just too far from us on foreign policy. Apart from that, we’ll talk to all democratic parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4080, \"fields\": {\"question\": 737, \"description\": \"The only realistic path to a true left-wing government is with the SPD and the Left party. My favourite coalition would be with those two, I’m certain we can find compromises on contentious topics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4081, \"fields\": {\"question\": 737, \"description\": \"While I won’t rule out a coalition with the Left party, they would have to make significant concessions. It’s easier to imagine a stable government without them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4082, \"fields\": {\"question\": 738, \"description\": \"Both parties in government, the CDU/CSU and the SPD screwed up here. No matter how much they’re blaming each other, the voters will see that we need to move on from both of them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4083, \"fields\": {\"question\": 738, \"description\": \"Right now, it’s important that we don’t instrumentalize this topic for the election, but work to find concrete solutions to help the people. The Green Party is willing to work with the government to that end.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4084, \"fields\": {\"question\": 738, \"description\": \"We need to evacuate as many people from Afghanistan as possible, especially people who cooperated with our troops, journalists and women’s rights activists. They are very endangered after the Taliban takeover.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4085, \"fields\": {\"question\": 738, \"description\": \"The Green Party is a party of pacifism, and we’ve been against this war in Afghanistan from the start. While the pictures are tragic and we need to do what we can to help, this whole episode shows why we shouldn’t get involved in these types of conflicts.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4086, \"fields\": {\"question\": 739, \"description\": \"It will be easier to win over SPD voters, so I will focus on attacking Scholz.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4087, \"fields\": {\"question\": 739, \"description\": \"Laschet seems like the better target, considering how much he struggled during this election campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4088, \"fields\": {\"question\": 739, \"description\": \"Actually, I don’t want to attack anyone, I want to remain positive and above the fray.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4089, \"fields\": {\"question\": 739, \"description\": \"I’ve been invited to this debate, yes, but I doubt the moderators will give me a fair shake. I refuse to participate!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4090, \"fields\": {\"question\": 740, \"description\": \"He’s the incumbent vice chancellor and has been a part of the Grand coalition for the last four years. People who want real change in this country have to look elsewhere!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4091, \"fields\": {\"question\": 740, \"description\": \"I want to hit him on his scandals, both as finance minister and earlier. He mishandled the Wirecard collapse, was involved in the cum-ex banking scandal and had a disastrous response to the G20 meeting when he was mayor of Hamburg.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4092, \"fields\": {\"question\": 740, \"description\": \"He’s just not as leftwing as he pretends to be now, not on climate change, not on social security. He’s always been known as a moderate, I’ll attack him on not being serious about all the change promised in the SPD program.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4093, \"fields\": {\"question\": 740, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4094, \"fields\": {\"question\": 741, \"description\": \"Luisa Neubauer, the most famous German Fridays For Future activist, is actually a member of the Green Party. I want to hold some campaign events with her.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4095, \"fields\": {\"question\": 741, \"description\": \"For the whole campaign, Robert Habeck has helped me campaign, and I want to do some appearances with him in the final days.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4096, \"fields\": {\"question\": 741, \"description\": \"There will be state elections in Berlin and Mecklenburg-Vorpommern parallel to the federal elections. I want to campaign with Bettina Jarasch in Berlin to help make her the second Green head of state government!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4097, \"fields\": {\"question\": 741, \"description\": \"Winfried Kretschmann is the only Green Minister-President and a very important figure of the moderate wing of our party. I want to campaign with him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4098, \"fields\": {\"question\": 742, \"description\": \"I trust the German people to choose the most competent candidate and party, there is no need for additional attacks here.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4099, \"fields\": {\"question\": 742, \"description\": \"The Green Party has always been in favour of more transparency -  these scandals show why we desperately need to do more against corruption.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4100, \"fields\": {\"question\": 742, \"description\": \"Yes, I want to attack the CDU/CSU here. The amount of corruption, so many of their MPs trying to profit from the pandemic is appalling. They shouldn’t stay in power.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4101, \"fields\": {\"question\": 742, \"description\": \"Yes, I want to attack Olaf Scholz. Both as mayor of Hamburg and as Finance Minister, he has been involved in shady dealings. He is frankly not qualified to become chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4102, \"fields\": {\"question\": 743, \"description\": \"Actually, let’s lean into this. I’ve studied Political Science and International Law - what else could have prepared me better for the position of German chancellor?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4103, \"fields\": {\"question\": 743, \"description\": \"While I might not have the practical experience, I am a working mother. I want to focus on that part of my biography, to show me as more approachable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4104, \"fields\": {\"question\": 743, \"description\": \"This is a problem all parties in the Bundestag struggle with - there are many more people with a college degree than without in our parliament. We all have to work together to change this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4105, \"fields\": {\"question\": 743, \"description\": \"I reject the notion that you must have personally experienced something to find the right answers. The point of representative democracy is to choose politicians to represent the people, they don’t have to be like them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4106, \"fields\": {\"question\": 744, \"description\": \"I’ve made some mistakes, yes, but these accusations are unfair and completely blown out of proportion. I will get a media lawyer to fight back.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4107, \"fields\": {\"question\": 744, \"description\": \"It was a mistake to publish the book in its current state and I apologize for this lapse in judgement. My intention was not to deceive anyone, I simply used quoted widely available facts.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4108, \"fields\": {\"question\": 744, \"description\": \"This book hasn’t been written by just me, I had a co-author. I’ll make it clear that most of the problematic parts were his responsibility and I didn’t have much to do with them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4109, \"fields\": {\"question\": 744, \"description\": \"I won’t give this smear campaign any oxygen. This book is a biography, not a scientific text, and this right-wing propaganda war against my person is pathetic.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4110, \"fields\": {\"question\": 745, \"description\": \"Yes, I do! I want to promote the book whenever I give a public speech somewhere and sell copies at a discounted price to get it out to as many people as possible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4111, \"fields\": {\"question\": 745, \"description\": \"Yes, I do! I want to point towards the book as a serious contribution to the most important policy debate this country has right now. I’ll send copies to journalists and intellectuals so they can review the book.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4112, \"fields\": {\"question\": 745, \"description\": \"Actually, I don’t want to make it a big part of my strategy, no. I’ll announce that it has been published, but won’t do anything special to promote it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4113, \"fields\": {\"question\": 746, \"description\": \"It is legitimate that unvaccinated people don’t have the same rights and privileges as vaccinated people. Maybe that will help convince everyone to get vaccinated.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4114, \"fields\": {\"question\": 746, \"description\": \"We are doing a lot to get everyone vaccinated right now without thinking about the consequences. What if the vaccine is toxic? We should try some more natural medicine instead.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4115, \"fields\": {\"question\": 746, \"description\": \"At this point, we don’t need mandatory vaccinations, though it is something that might be needed later on if the vaccination rates stay too low.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4116, \"fields\": {\"question\": 746, \"description\": \"Overall, we are on the right path with the vaccination campaign. We need to do more to reach everyone though, including mobile vaccination teams going to areas with low vaccination rates.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4117, \"fields\": {\"question\": 747, \"description\": \"Our main opponent is the CDU, so I will emphasize our moderation and commitment to lead a sensible government. I’m also a better candidate than Laschet!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4118, \"fields\": {\"question\": 747, \"description\": \"The SPD is down, but still the party that’s politically most similar to us, so their voters should be easiest to win over. I will make an effort to target them and get them to vote Green this election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4119, \"fields\": {\"question\": 747, \"description\": \"It looks like the Left party might struggle to reach 5%. I’ll specifically target their voters, maybe we can keep them out of parliament and simplify finding a majority.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4120, \"fields\": {\"question\": 747, \"description\": \"They might be a bit weaker than they were four years ago, but the amount of votes the AfD is projected to receive is still way too high. I’ll try to win over some of their voters.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4121, \"fields\": {\"question\": 748, \"description\": \"His erratic response to the disastrous floodings this summer shows that he lacks the temperament to be a good chancellor. Germany deserves someone better than him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4122, \"fields\": {\"question\": 748, \"description\": \"The program of his party regarding climate change is very unambitious. In the past, the CDU/CSU has not done enough to combat climate change, and this wouldn’t change with Laschet as chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4123, \"fields\": {\"question\": 748, \"description\": \"For the last 16 years, this country has been governed by the CDU/CSU, and they are out of ideas on what to do in government. This country needs change and Laschet is not the right man to deliver it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4124, \"fields\": {\"question\": 748, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4125, \"fields\": {\"question\": 749, \"description\": \"The CDU/CSU has been in government for 16 years, the SPD for 8. This country needs change, and I’m a fresh face that can deliver it, unlike the other two candidates.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4126, \"fields\": {\"question\": 749, \"description\": \"There is one issue that really matters in this election: Climate change! I’m the only one to have a program that’s ambitious enough to truly make a difference.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4127, \"fields\": {\"question\": 749, \"description\": \"I’d like to focus on our social policies, like a higher minimum wage, higher taxes for the rich and a reform of the Hartz IV system.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4128, \"fields\": {\"question\": 749, \"description\": \"Actually, screw this! I will attack them both whenever an opportunity presents itself. That way, I can sharpen my profile and show myself as the most competent candidate.\"}}]");
