for (let i = 0; i < 7; i++) {
  polling.push([]);
  prepolling.push(simulateMA(25,5));
}

cyoAdventure = function (a) {
    ans = campaignTrail_temp.player_answers[campaignTrail_temp.player_answers.length - 1]
    let pop_vote = getLatestRes(A(return_type=2))[0];
    let playerPolling = (pop_vote.find(p => p.pk === 79)).pvp;
    let i = 0;

    pop_vote.sort((a, b) => {
      return a.pk - b.pk;
    });

    // record the current polling data for all parties and inject some randomness
    pop_vote.forEach((entry) => {
      polling[i].push(Math.round(entry.pvp*1000*prepolling[i][campaignTrail_temp.question_number])/10);
      i++;
    });


	if (ans === 4001) {
	    campaignTrail_temp.questions_json[7]=extraQuestions[0];
	    campaignTrail_temp.questions_json[9]=extraQuestions[1];
	    campaignTrail_temp.questions_json[13]=extraQuestions[2];
	}

    if (ans === 4000) {
       campaignTrail_temp.questions_json[13]=extraQuestions[3];
    }

    if (ans === 4087) {
       campaignTrail_temp.questions_json[23]=extraQuestions[6];
    }

    if (ans === 4088) {
       campaignTrail_temp.questions_json[23]=extraQuestions[7];
    }

     if (ans === 4089) {
       campaignTrail_temp.question_number=23;
    }

    //polling collapse is stopped if Greens are close enough to the CDU and far enough from the SPD
    if ([4063, 4064, 4065, 4066].includes(ans)) {
        if (pop_vote[0].pvp-playerPolling<playerPolling-pop_vote[1].pvp ) {
        campaignTrail_temp.questions_json[17]=extraQuestions[4];
        campaignTrail_temp.questions_json[18]=extraQuestions[5];
        }
    }
    //coalition weight adjustments here
    if ([4011, 4013, 4042].includes(ans)) {
       coalitions.forEach(coalition => {
          if ([3, 5].includes(coalition.id)) {
            coalition.weight += 0.2;
          }
          if (coalition.id === 12) {
            coalition.weight -= 0.1;
          }
        });
    }

      if (ans === 4021) {
       coalitions.forEach(coalition => {
          if ([1, 3, 4, 5].includes(coalition.id)) {
            coalition.weight += 0.2;
          }
        });
    }

     if (ans === 4079) {
       coalitions.forEach(coalition => {
          if (coalition.id === 12) {
            coalition.weight = 0.0;
          }
        });
    }

     if (ans === 4080) {
       coalitions.forEach(coalition => {
          if (coalition.id === 12) {
            coalition.weight += 0.5;
          }
          if ([3, 5, 6].includes(coalition.id)) {
            coalition.weight -= 0.4;
          }
        });
    }

     if (ans === 4081) {
       coalitions.forEach(coalition => {
          if (coalition.id === 12) {
            coalition.weight -= 0.25;
            //make sure the coalition is always visible, but might be basically impossible
            coalition.weight = Math.max(coalition.weight, 0.001);
          }
        });
    }

    //only chart a full campaign
    if([4097, 4096, 4095, 4094].includes(ans)){
        charts.push("line");
    }

    else
    {
        return false
    }
}

